const colorArr = []
function getRandomColor() {
  var letters = '0123456789ABCDEF';
  var color = '#';
  for (var i = 0; i < 6; i++) {
    color += letters[Math.floor(Math.random() * 16)];
  }
  if(colorArr.indexOf(color) === -1) {
    colorArr.push(color)
    return color;
  } else {
    return getRandomColor()
  }
}
function getColor() {
  const colorObj = {};
  for(var i = 80; i < 1700; i += 80) {
    colorObj[i] = getRandomColor()
  }
  return colorObj
}
function formateData(data) {
  var arr = [], itemArr = [];
  console.log("-------len:",data.length)
  for (var i = 0; i < data.length; i++){
    if(itemArr.length === 120) {
      arr.push(itemArr);
      itemArr = []
    }
    itemArr.push(data[i])
  }
  return {
    list: arr,
    color: getColor()
  }
}

